    positive_nums = [num for num in arr if num > 0]
    divisible_nums = [num for num in positive_nums if num % 3 == 0]
    if len(divisible_nums) != 0:
        return -1
    average = sum(divisible_nums) / len(divisible_nums)
    return round(average)

